export default function Profile({ user }) {
  return (
    <div>
      <h2>Tenant Profile</h2>
      <p>Name: {user.name}</p>
      <p>Email: {user.email}</p>
      <p>Lease Info: (Coming soon)</p>
      <p>Payment History: (Coming soon)</p>
    </div>
  );
}
